window.notificationVM=new Vue({el:"#notifications",data:{newer:[],older:[]},filters:{ago:function(t){return moment.utc(t,"YYYY-MM-DD HH:mm:ss").fromNow()}},methods:{getFetchUrl:function(){return this.$el.dataset.fetchUrl},fetchAll:function(){var t=this,e=t.getFetchUrl();$.get(e).done(function(e){var n=e.data;t.newer=n["new"],t.older=n.old})}},mounted:function(){this.fetchAll()}});